import './App.css';
import Login from './components/Login';
import Connecte from './components/Connecte';
import Signup from './components/Signup';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
                <Link to="/login">Je n'ai pas de compte</Link>
                <Routes>
                    <Route path="/login" element={<Login />} />
                </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
